import React,{Component} from 'react';
import './Admin.css'
import {
    BrowserRouter as Router,
    Route, NavLink, Switch
} from "react-router-dom";
class Admin extends Component{
  render(){
      return(
        <Router>
            <ul className="nav">
                <button>a</button>
            </ul>
            <div className="navright">aaa</div>
        </Router>
      )
    }
}
export default Admin;
